void plot_image(int initialX, int initialY, int imageArray[], unsigned width, unsigned height) {

    int i = 0; // index for pixel colours in the image array

    for (unsigned y = 0; y < height; y++) {
        for (unsigned x = 0; x < width; x++) {
            int plotX = initialX + x;
            int plotY = initialY + y;

            // check for magenta, which is selected as a substitute of the alpha(transparent) colour
            // when the pixel is out of bound, ignore it
            if (imageArray[i] != 0b1111100000011111 && plotX >= 0 && plotY >= 0 && plotX < 320 && plotY < 240)
                plot_pixel(plotX, plotY, imageArray[i]);

            i++; // switch to the next pixel colour
        }
    }
}

void wait_for_vsync() { 
    volatile int* pixelCtrlPtr = (int*) 0xFF203020; 
    /* Read location of the pixel buffer from the pixel buffer controller */
    register int status; 

    *pixelCtrlPtr = 1; 
    status = *(pixelCtrlPtr + 3); 
    while((status & 0x01) != 0) { 
        status = *(pixelCtrlPtr + 3); 
    } 
} 

void draw() { 
    clear_screen();

    if(globalY + sizeY >= maxY || globalY + delta < 0) delta *= -1;
	if(globalX + sizeX >= maxX || globalX + delta2 < 0) delta2 *= -1;
    globalY += delta;
	globalX += delta2; 

    draw_line(globalX, globalY, globalX + sizeX, globalY, 0x001F);
    draw_line(globalX, globalY, globalX, globalY + sizeY, 0x07E0); 
    draw_line(globalX, globalY + sizeY, globalX + sizeX, globalY + sizeY, 0xF800); 
    draw_line(globalX + sizeX, globalY, globalX + sizeX, globalY + sizeY, 0xFFFF); 
    draw_line(globalX + sizeX, globalY, globalX, globalY + sizeY, 0xF81F); 

}

