void draw_line(int startX, int startY, int endX, int endY, short int line_color) {
    _Bool isLineSteep = abs(endY - startY) > abs(endX - startX);

    if(isLineSteep) {
        swap(&startX, &startY);     //swap(x0, y0)
        swap(&endX, &endY);         //swap(x1, y1)
    } else if (startX > endX) {
        swap(&startX, &endX);       //swap(x0, x1)
        swap(&startY, &endY);       //swap(y0, y1)
    }
    int deltaX = endX - startX; 
    int deltaY = abs(endY - startY);
    int error = -1 * (deltaX / 2); 
    int y = startY; 
    int yStep; 
    if(startY < endY) yStep = 1;
    else yStep = -1;
    for(int x = startX; x <= endX; x++) {
        if(isLineSteep) plot_pixel(y, x, line_color);       //draw(y,x)
        else plot_pixel(x, y, line_color);                  //draw(x,y)
        error = error + deltaY; 
        if(error >= 0) {
            y += yStep; 
            error -= deltaX;
        }
    }
}



void plot_pixel(int x, int y, short int line_color) {
    *(short int *)(pixelBufferStart + (y << 10) + (x << 1)) = line_color;
}


void swap(int* numberA, int* numberB) {
    int temp = *numberA;
    *numberA = *numberB;
    *numberB = temp; 
}
